import { Component } from "react";
import HomeView from '../../component/views/dashboard/homeView';
import {BrowserRouter} from 'react-router-dom';

class Dashboard extends Component {

    render(){
        return(
            <BrowserRouter>
                <HomeView />
            </BrowserRouter>
        )
    }

}

export default Dashboard;
